import React from 'react'
import PropTypes from 'prop-types'

function List(props) {
  console.log(props.loadingList)
  return <div>{!props.loadingList ? props.listData[0].name : 'ankit'}</div>
}
List.propTypes = {
  loadingList: PropTypes.bool.isRequired,
  listData: PropTypes.array.isRequired
}
export default List
